  [],\n\t\"revision_timestamp\": \"2016-07-27T22:41:28.954826\",\n\t\"name\": \"nm-risk-and-injury-assessment-of-radionuclides-to-los-alamos-fauna\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This is an assessment of environmental
  contaminants associated with the Los Alamos National Laboratory. One objective of
  the study is to determine if a significant correlation exists between the amount
  of DNA damage in the red blood cells of fish and the concentrations of radionuclides
  in the water, sediment, or foods (macroinvertebrates) in their environment or measured
  in the fish (whole body). We will determine if sediment contamination contributes
  to increased chromosomal damage in fish after exposure. Results of this study will
  be used to understand the risks and impacts of low level particle radiation on aquatic
  species. We will also be able assess whether threatened (bald eagle) or endangered
  (Rio Grande silvery minnow, southwestern willow flycatcher) species' health are
  at risk when they inhabit a radionuclide-contaminated environment and thereby, provide
  information to assist ongoing Section 7 consultations.\",\n\t\"license_title\":
